					["NPC:135795"] = true,
				},
			},
			[52253] = {
				["reward_text"] = "Okay, we have the keys. Now we just need to make a run for the chest.",
				["progress_text"] = "Nicely done! See? I knew those Irontide wouldn't be a problem for you.",
