					["NPC:141032"] = true,
				},
			},
			[49926] = {
				["reward_text"] = "Good, you've arrived. \r\n\r\nThis tower watches over Corlain and the surrounding lands. Apparently it is of little value to the coven, but to us it would serve as a valuable foothold.",
				["can_share"] = true,
				["end"] = {
					["NPC:131636"] = true,
				},
			},
			[51209] = {
				["reward_text"] = "I can't believe it actually worked. I thought for sure we'd all be squished!",
				["can_share"] = true,
				["end"] = {
					["NPC:136574"] = true,
				},
			},
			[52449] = {
				["reward_text"] = "Fate's End! Merciful Tides, I'd hoped she wouldn't have been sent there... But of course she would be.\r\n\r\nNo matter. I must forge ahead.",
				["end"] = {
					["NPC:140495"] = true,
				},
			},
			[53476] = {
				["reward_text"] = "Oh my! Is that a complete set of the Ruinous Pilgrimage? With a first-generation scroll case to boot?\r\n\r\nWhy, I haven't seen one of those in decades! Here, here, I have a nice hat I acquired in a trade from a tall fellow some years ago. Said he was from \"up north\".\r\n\r\nDid I ever tell you the stories that my father's mother's father told me about the days of the pilgrimage? It all started with that scoundrel from... hey, where are you going?",
				["progress_text"] = "What's that you have there?",
				["end"] = {
					["NPC:135793"] = true,
				},
			},
			[50955] = {
