			[52790] = {
				["reward_text"] = "<name>! I only just received the message of your success in Zandalar. Well done.\r\n\r\nI'm sorry for everything that you've been put through on behalf of this war. We have only one option if we want to stop the Zandalari from aiding the Horde.\r\n\r\nWhen the time is right, we will send our fleets to Zandalar. Your hard work will ensure we have a breach in their defenses to begin our invasion.\r\n\r\nThank you once more, <name>. We owe a great debt to you and your allies.",
				["can_share"] = true,
				["end"] = {
					["NPC:107574"] = true,
				},
			},
			[50762] = {
				["reward_text"] = "Her mother ordered the assassination!?\r\n\r\nI had known that she didn't agree with Lucy marrying a merchant, but I would never suspect she would go so far to prevent it!\r\n\r\nThank you, <class>.",
